    const pinkGradient = document.getElementsByClassName("pinkGradient");
    const purpleGradient = document.getElementsByClassName("purpleGradient");

    // Set initial state
    gsap.set(points, { scale: 0, transformOrigin: "center" });
    gsap.set(points1, { scale: 0, transformOrigin: "center" });

    // Get the total length of each path
    const pinkLength = pinkPath.getTotalLength();
    const purpleLength = purplePath.getTotalLength();

    // Set initial dash array and offset
    gsap.set(pinkPath, {
      strokeDasharray: pinkLength,
      strokeDashoffset: pinkLength,
    });
    gsap.set(purplePath, {
      strokeDasharray: purpleLength,
      strokeDashoffset: purpleLength,
    });

    // Set initial gradient positions
    gsap.set([pinkGradient, purpleGradient], {
      attr: { x1: "0%", y1: "0%", x2: "0%", y2: "0%" },
    });

    const tl = gsap.timeline();

